window.bookSummaryJSON = "Brian Tracy is one of the world's leading authorities on success and personal achievement, addressing more than 100,000 men and women each year in public and private seminars. In <i>Maximum Achievement</i>, he gives you a powerful, proven system based on 25 years of research and practice that you can apply immediately to get better results in every area of your life. <p> You will learn ideas, concepts, and methods used by high-achieving people in every field everywhere. You'll learn how to unlock your individual potential for personal greatness. You will immediately become more positive, persuasive, and powerfully focused in everything you do. Many of the more than one million graduates of the seminar program upon which this book is based have dramatically increased their income and improved their lives in every respect.</p> <p> The step-by-step blueprint for success and achievement presented includes proven principles drawn from psychology, religion, philosophy, business, economics, politics, history, and metaphysics. These ideas are combined in a fast-moving, informative series of steps that will lead you to greater success than you ever imagined possible. They can raise your self-esteem, improve personal performance, and give you complete control over every aspect of your personal and professional life.</p>"; 
